import React from 'react';
import Card from './Card'
import {Link} from 'react-router-dom';
import './CardList.css'


const CardList = ({ main }) => {
	return(
		<div className = "boots">
          		 <Link to="/Curriculum"><Card 

          		  id={main[0].id} name={main[0].name} email={main[0].email} className = "col col-lg-4"/></Link>

                 <Link to="/About"><Card

                  id={main[1].id} name={main[1].name} email={main[1].email} className = "col col-lg-4"/></Link>
                 <Link to="/Testimonials"><Card 

                 id={main[2].id} name={main[2].name} email={main[2].email} className = "col col-lg-4"/></Link>
              </div>  

		)
}

export default CardList;
